import { createMuiTheme } from "@material-ui/core/styles";

export default createMuiTheme({
  palette: {
    primary: {
      light: "#6d6d6d",
      main: "#424242",
      dark: "#1b1b1b",
      contrastText: "#ffffff"
    },
    secondary: {
      light: "#ae52d4",
      main: "#7b1fa2",
      dark: "#4a0072",
      contrastText: "#ffffff"
    }
  }
});
